import style from "./Cards.module.css"
import Card from "../Card/Card";

const Cards= ({characters, onClose}) => {
   return(
      <div className={style.contenedor}>
         {
            characters.map(({id, name, status, species, gender, origin, image}) => {
               return(
                  <Card
                     key={id}
                     id={id}
                     name={name}
                     status={status}
                     species={species}
                     gender={gender}
                     origin={origin.name}
                     image={image}
                     onClose={onClose}
                  ></Card>
               )
            })
         }
      </div>
   )
}

export default Cards
